import { connect } from 'react-redux'
import { generateCard, setInitializeIdCampaign } from '../../modules/home/actions'
import { linkCardToUserProfile } from '../../modules/settings/actions'
import Redirect from '../../components/RedirectPage'

const mapStateTopProps = (state) => {
  return {
    isGeneratingCard: state.home.isGeneratingCard,
    error: state.home.error,
    token:state.home.token
  }
}

const mapActionCreators = {
  generateCard,
  setInitializeIdCampaign,
  linkCardToUserProfile 
}

export default connect(mapStateTopProps, mapActionCreators)(Redirect)
